import React, { useEffect } from 'react';
import { getData } from '../actions/index';
import { Table, Tag } from 'antd';

const Home = () => {
  useEffect(() => {
    getData();
  }, []);

  const columns = [
    {
      title: 'weight',
      dataIndex: 'weight',
      key: 'weight',
      render: (text) => <a>{text}</a>,
    },
    {
      title: 'Age',
      dataIndex: 'age',
      key: 'age',
    },
    {
      title: 'Address',
      dataIndex: 'address',
      key: 'address',
    },
  ];

  const data = [
    {
      key: '1',
      weight: 'John Brown',
      age: 32,
      address: 'New York No. 1 Lake Park',
      tags: ['nice', 'developer'],
      date: 14,
    },
    {
      key: '2',
      weight: 'Jim Green',
      age: 42,
      address: 'London No. 1 Lake Park',
      tags: ['loser'],
    },
    {
      key: '3',
      weight: 'Joe Black',
      age: 32,
      address: 'Sidney No. 1 Lake Park',
      tags: ['cool', 'teacher'],
    },
  ];

  return (
    <div style={{ margin: 30 }}>
      <div>
        <h1>Home</h1>
      </div>
      <Table columns={columns} dataSource={data} />
    </div>
  );
};

export default Home;
